import React from 'react'
import {Link, useNavigate, useLocation} from 'react-router-dom'
import axios from 'axios';

function Header({setData, user}) {
  const KEY = 'ac733e4361119585d5f69a529226d016';
  const btnSearch = (e) => {

      axios.get(`https://kobis.or.kr/kobisopenapi/webservice/rest/movie/searchMovieList.json?key=${KEY}&movieNm=${e.target.value}`)
      .then(function(response){
        console.log(response);
      })

  }

  return (
    <div className="flex flex-row px-[10rem] py-[15px]  items-center">
      <Link to="/" className="no-underline" state={user}>
        <span className="cursor-pointer text-[22pt] font-extrabold w-fit text-[#FFD177]">FavieList</span>
      </Link>


      <div className="w-full">
        <form className="group relative mx-5">

          <input className="form-input block
          py-2 pl-10 w-full
          rounded-md border-[#D9D9D9] shadow-m font-medium text-[#000000]
          focus:border-[#64A2BD] focus:ring focus:ring-[#64A2BD] focus:ring-opacity-50
          placeholder:font-medium placeholder:text-[#888888]"
          type="text" placeholder="Search"/>

          <p className="cursor-pointer bg-[#ffffff] w-full rounded-md shadow-sm px-4 py-1
            text-black ring-[#FF6F6F]/[0.4] ring-[2px] text-[15px] font-medium text-center"
            onClick={btnSearch}>
              <svg width="20" height="20" className=" fill-[#D9D9D9] absolute left-2 top-1/2 -mt-2.5 text-slate-400 pointer-events-none group-focus-within:fill-[#64A2BD]" aria-hidden="true">
            <path d="M8 4a4 4 0 100 8 4 4 0 000-8zM2 8a6 6 0 1110.89 3.476l4.817 4.817a1 1 0 01-1.414 1.414l-4.816-4.816A6 6 0 012 8z" />
          </svg>
                </p>
        </form>
      </div>
      <Link to="/favlist" className="no-underline" state={user}>
      <span className="cursor-pointer text-[30pt] text-[#FF6F6F] font-medium w-fit">♥︎</span>
      </Link>



    </div>
  )
}
export default React.memo(Header);
